import React,{Component} from "react"
import { Route } from "react-router";
import './App.css';

class App extends Component {
  render() {
    return (
 

    <>
         <div className="App">
          <h1>Welcome to React Router!</h1>
        </div>

        <Routes>
        <Route>
              <Login />
                <User />
        </Route>
          </Routes>
    </>

     
    );
  }
}

export default App;
